(64, 'Jean-michel rotin', 'Jean-Michel Rotin, né en Guadeloupe le 2 avril 1970, est un chanteur, auteur, compositeur et producteur français.\r\n\r\nIl a d''abord connu le succès dans les années 1980 avec le groupe Energy, maintenant appelé New J, puis a entamé une carrière solo au milieu des années 1990. Il est un des créateurs du Zouk RnB (mélange de zouk lov et de Rnb). En 1996, Jean Michel Rotin se lance dans la production sous le label "Stuff Records". Il vit désormais à Londres après avoir dénoncé "le racisme latent" en France.', '2013-07-14 18:40:00', 'jean-michel-rotin', NULL, NULL),
