(75, 'Esy Kennenga', 'Esy Kennenga est né le 17 mars 1984 en Martinique\r\nd''une famille de musiciens2. Dès l''âge de 5\r\nans, il étudie la guitare. A 14 ans, il écrit ses premières\r\ncompositions. Avec le groupe "One Day"3,\r\nil fait ses premiers pas sur scène et deux albums\r\nsont édités "Un jour" en 2001, puis "Il Faut Le Dire"\r\nen 2003.\r\nIl rencontre alors le compositeur martiniquais Joël Jaccoulet et intègre le "B.Carribean Crew", composé à\r\nl''époque de Goldee et Perle Lama. Il collabore à de nombreuses compilations.\r\nSon premier album solo EK Trip sort le 30 août 2010. On y retrouve Pa Pè, Love Adan Tchè Mwen, Truc de\r\nFou et Pinting Party qui donnera un remix avec l''artiste guadeloupéen Admiral T. À la n de l''année, son\r\nconcert au New Morning aINSERT IGNORE INTO `Artiste` (`id`, `libelle`, `description`, `dateArtiste`, `slug`, `tag_facebook`, `tag_twitter`) VALUES
