(320, 'Sydney william', 'Sydney William est un jeune chanteur (auteur, interprète) au style et au timbre de voix particuliers.\r\n\r\nBercé par la musique (hip-hop, rnb-soul, pop, variété, zouk) depuis son plus jeune âge, c''est bien plus tard qu''il décidera de s''investir dedans.\r\n\r\nDésireux de se créer son propre univers, et qui soit en accord avec sa personnalité, calme, posée, émotive, Sydney William se lance dans la vibe afro-caraïbéenne,ses textes et mélodies se mariant parfaitement avec les sonorités zouk-rnb du moment.', '2014-01-13 09:50:00', 'sydney-william', 'SydneyWilliamMizik', 'Sydney__William'),
