(334, 'Saaphy', 'Elle se nomme SAAPHY.\r\n\r\nOriginaire des antilles elle fût depuis son plus jeune âge attirée par la musique. A 16 ans elle intègre le groupe de gospel "4 ur soul" et c''est en 2009 qu''elle fît son apparition sur les écrans TV lors de l''émission X Factor.\r\n\r\nCette jeune femme âgée de 24 ans se caractérise par un timbre très particulier et une technique impressionnante.\r\n\r\nFan de Aaliyah, Mary J Blige et Perle Lama c''est sans prétention que SAAPHY s''inspire de ces divas pour nous proposer son univers.\r\n\r\nLe 1er titre de SAAPHY "Game Over" est déjà un succès auprès du public Kizomba.\r\n\r\nEcrit et composé par Elji Beatzkilla\r\nRéalisé par moi-même MOUN', '2014-01-23 13:39:00', 'saaphy', 'melanie.saaphyna', 'SaaphyMusic'),
