(352, 'Crazy', 'Rubens Figaro plus connus sur le nom de Crazy est née le 21 Mars 1995 sur île de saint martin.depuis son tout jeune ages il est passionné de musique,et de chant au collège celui -ci a été introduit dans le Rap RnB par plusieurs de c''est amies qui trouvais qu''il avait un talent .en 2013 un mois avants les examen du bac Crazy compose une chanson nommé ( toujours la ) en collaboration avec son groupe One Way Music composer de plusieurs passionner.', '2014-01-29 09:49:00', 'crazy', NULL, NULL),
(353, 'Titonton', 'TITONTON est né le 08 Décembre 1995 à St-Martin. Passionné de la vie aimant le sport et la musique. Amoureux de musique, Dès l''âge de 10 ans il s''est mit a écrire des textes par passion, mais au fil du temps il écrit des textes un peu plus sensé et influencé par plusieurs chanteurs comme Axel Tony et Marvin, il écrit des choses basés sur des faits réel, sa première composition (Toujours La ft Crazy) en est l''exemple. Son groupe One Way Music Group composer de deux Beats maker Frizzybeatz & ShadBeatz, et de deux artistes Titonton et Crazy.', '2014-01-29 09:51:00', 'titonton', NULL, NULL),
