(492, 'Océane', 'Océane est une jeune artiste et interprète de 20 ans d’origine Guadeloupéenne, « Océane », de son vrai nom Steffie Rangassamy,\r\ns’immisce au sein de la sphère du Zouk afin de vous faire partager ses 12 ans de passion pour la musique.\r\nInfluencée par de nombreux styles musicaux, notamment le R&B américain et la variété française et anglophone,\r\nelle débute le chant au sein d’une chorale à l’âge de 7 ans dans laquelle elle reste pendant 9 ans.\r\nPar la suite, elle se fait connaitre sur divers concours à l’échelon régional.\r\nEn 2012 , elle est finaliste au Défi lycéen ( concours inter-lycées caribéen sponsorisé par Guadeloupe Première)\r\net l’année suivante finaliste du concours Start dans la catégorie Musique (concours organisé par le Conseil Général de la Guadeloupe parrainé par Krys).\r\n« Océane » qui jusque-là ne chantait qu’en anglais n’eut le déclic qu’en cette année 2014.\r\nSi auparavant elle ne se voyait pas chanter du Zouk, ce n’est qu’une fois éloignée de sa terre natale\r\npour poursuivre ses études qu’elle découvre son engouement pour sa culture caribéenne.\r\nAinsi, aujourd’hui, après s’être longtemps identifiée à un style anglophone\r\nelle vient vous faire redécouvrir sa propre culture avec des morceaux qui vous feront\r\ntraverser tous les Océans. Leurs paroles, « Deeper than the Ocean », vous toucheront de par leurs sincérités et leurs profondeurs.\r\nElle rencontre , en Janvier 2014, DavBeatz qui deviendra son producteur et signe chez Dark Lullaby Music Group.', '2014-05-13 14:44:00', 'oceane', 'OceaneDLMG', 'OceaneDLMG'),
