(516, 'Doctor ly', 'Doctor Ly est à la fois le docteur Jekyll et Mr Hyde de la musique; sérieux et complètement déluré, c''est un artiste " double face".\r\nChanteur de ragga dancehall d''origine martiniquaise, sa vie musicale est une parfaite dualité.\r\nD''un côté le hip hop, le rnb et la dance qui ont bercés son enfance passée en banlieue parisienne, et de l''autre la musique caribéenne, et plus particulièrement le ragga dancehall découvert  et adopté durant son adolescence passée en Martinique.\r\nC''est d''ailleurs là-bas qu''en 1999 à l''âge de 16 ans, il enregistre son premier titre aux influences reggaeton Dame la mano, et fait ses premières scènes.\r\nLe titre apparaîtra  sur la compile  DANCEHALL NEWS, produite par Don''s Music.\r\n\r\nDe 2002 à 2006 de retour en métropole pour poursuivre des études supérieures, il participe aux différentes compiles successives de dj Halan, ce qui lui donne l''opportunité de chanter sur l''une des plus  grandes scènes mythiques de Paris, le Zénith.\r\nProfitant de ces différentes expositions  il sort en parallèle de nombreux morceaux underground diffusés majoritairement sur internet et non commercialisés. Il participera aussi à de nombreuses mixtapes.\r\nFort de cette toute fraiche notoriété il sort un de ses titres phares « Vini vini ».\r\n\r\nReconnaissable par  son déguisement de docteur sur scène et dans certains de ces clips vidéos Doctor Ly se démarque surtout par un charisme scénique et une originalité propre à lui-même.\r\nEn 2012 que Doctor Ly vient présenter son premier single officiel  « double face », production indépendante mettant en avant cette ambivalence qui le caractérise à la fois humainement et musicalement.\r\nIl poursuit  en 2013 avec un second single « sweet créole »,  exprimant  son attirance et son amour pour la femme créole dans son ensemble.\r\nCette année 2014,  c’est le retour du show man. \r\n« Doctor ly shake » titre de son nouveau single, nous rappelle que parmi toutes les facettes de Doctor Ly, il ne faudrait pas oublier celle de  « l’ambianceur » qui sait par sa musique faire remuer ses patients.', '2014-06-05 16:08:00', 'doctor-ly', 'DOCTORLYOFFICIEL', 'doctorly_lmy'),
