(542, 'Rubby', 'Rubby est une jeune chanteuse d''origine martiniquaise et indienne .C’est par sa voix que Rubby a été révélée lors de la première édition de The Voice.\r\n\r\nRubby a sans cesse travaillé depuis pour livrer un album surprenant, exigeant et irrésistible.\r\n\r\nVeritable revelation, Rubby offre ici le 1er extrait d’un album de pop urbaine aux sonorités\r\n\r\n“elec tro-pical” pour un mélange des plus détonants.', '2014-06-20 17:07:00', 'rubby', 'RubbyMusic', 'batteryrubby'),
