(696, 'Madoo nina', 'Madoo Nina est Beatmaker, Auteur, Compositeur,Interprète, Madoo mélange subtilement les beats et les sonorités d''influences\r\ndiverses: hip hop, Soul, Funk, Jazz. Il chante uson Nu Soul, une vibe créole, des textes en français, créole, anglais.Aux premières notes, le voyage commence, imprégné de cet envoutant\r\nunivers Créole... Des textes recherchés, une vision réaliste mais résolument optimiste et empreinte d''humour,\r\nsur la vie, la société... Le son Madoo, c’est un peu comme un punch créole: coloré, frais, sucré et fort à la fois... A\r\nconsommer sans modération.', '2014-11-13 19:38:00', 'madoo-nina', '599822823482457', 'madoonina'),
(697, 'Annilka', 'Née à Cayenne, un 4 octobre 1985, la chanteuse ANNILKA est promise au succès!\r\n\r\n1993: Son père l''inscrit à l''école de Musique et Danse de Guyane (ENMD) pour apprendre à jouer du \r\nsaxophone et se familiariser au solfège. La même année, elle joue déjà dans un orchestre de musique \r\npour apprendre son instrument et découvre les grands classiques mazurka, biguine et jazz.\r\n\r\nEn 1996: Elle participe avec son ensemble instrumental aux orchestrades de la caraïbes en \r\nGuadeloupe. Elle intègre par la suite différentes formations lives dont elle assure la voix lead. L''année \r\n\r\n2000, ANNILKA met sa passion musicale entre parenthèses afin de concrétiser d''autres projets et \r\ndébarque en France.\r\n\r\n2006: Rencontre avec le très talentueux Cédric Eudaric très connu sous le nom DJ SCIENTIFIK alias \r\nSTK. Dès lors une belle collaboration sans limite démarre.\r\nMais c''est en février 2007 lors d''une prestation, que LUC GUILLAUME (ex chanteur de DECIBEL) la \r\nrepère et lui propose très rapidement de participer à sa compilation intitulée "La Fièvre zouk du samedi soir" où elle interprètera son 1er titre "Que Dieu me pardonne!"\r\n\r\n2008: Rencontre avec Dj DIE qui l''invite sur sa 2ème compilation avec le titre " l amitié "\r\n\r\n2009: Elle nous revient avec le titre " je veux m ''enivrer" de MM Prod pour le bonheur de tous ceux qui l''encourage dans cette voie .\r\n\r\n2010: Participation sur une 3 ème compilation nommée "ghetto zouk 4" avec le titre " dois-je avancer ? " produite par POWER D PROD Décembre 2010 , ANNILKA sort son titre "si t ''en vas " composé par M.LUBINO\r\n\r\nJUIN 2011 Redécouvrez le titre "je veux m ''enivrer " sur la compilation ZOUK ISLAND 2011 100°/°100 tubes\r\n\r\nJUIN 2012 :sort son titre "Ma première fois" composé par KAIROS\r\n\r\nSEPTEMBRE 2014: elle revient avec le premier extrait de son premier opus .\r\nCoté tête, ANNILKA est une jeune femme déterminée et qui se bat avec ou sans le soutien de ceux qui l''entourent. Sa motivation n''est pas l''argent ni la gloire, mais tout simplement le fait d''être reconnue par le public les professionnels pour son travail et l''Amour qu''elle porte à la Musique.', '2014-11-13 19:49:00', 'annilka', NULL, 'Annilka_boyce'),
