(767, 'Fedia', 'Fedia est née le 7 janvier 1991 sous le soleil des Caraïbes, en Martinique. D’une mère Martiniquaise et d’un père Sicilien, elle a été bercée dès son plus jeune âge par différentes sonorités qui font la richesse de sa musique.\r\nSon métissage est sa force, ainsi que le reflet de son caractère, une jeune femme douce dotée d’un fort tempérament.\r\n\r\nAuteur et interprète, Fedia cherche à travers sa musique à partager ce métissage en se positionnant dans un style musical essentiellement urbain aux sonorités pop/caribéennes.\r\n\r\nFedia va trouver ses inspirations auprès d’artistes d’univers différents tels que Diplo, Rihanna, Bob Marley, Stromae ou encore Gwen Stefani. Avec sa musique, elle cherche à partager ce qu’elle ressent mais surtout à se faire plaisir afin que le public puisse ressentir l’énergie et la passion qui la caractérise.\r\n\r\nAprès un premier succès avec son titre « Wyner » en 2013, Fedia revient avec un projet musical en collaboration avec Blastar, avec lequel une véritable alchimie artistique s’est développée.\r\n« Pretty Gal » est le premier extrait de son EP de 7 titres prévu pour l’automne 2015.', '2015-02-26 07:36:00', 'fedia', 'FediaOfficiel', 'Fediaofficiel'),
(768, 'Flo', 'Artiste hip-hop gwada', '2015-02-26 22:33:00', 'flo', 'gwadaflo', 'Freemyflo'),
