(182, 'Mel''s', 'Mel''s, est plongée dans la musique dès son plus jeune âge. Fille d’un bassiste, elle apprend à jouer de la batterie à l’âge de 13 ans.\r\n\r\nOriginaire des Comores et vivant à Marseille, elle grandit et évolue dans un milieu éclectique.\r\n\r\nBercée par la musique de son île natale, mais aussi la musique Afro caribéenne, c’est à l’âge de 20 ans qu’elle se tourne vers le chant.\r\nAdolescente, elle s’imprègne des chants de Rythmes & Blues, soul, reggae. Ses artistes préférées sont Lauryn Hill, SWV, K-Reen, Toni Braxton, Alaine, Tessane Chin, Brandy, Tayna st val...\r\n\r\nAprès plusieurs années à perfectionner son art, c’est dans le milieu afro-antillais qu’elle est repérée par le groupe Zouk for life.\r\n\r\nTalentueuse, mature, discrète, elle décide enfin de s’inspirer de sa vie au quotidien et de s''entourer d''une équipe composée de Mainy Dog (Purple’n co) et Ali Angel pour sortir en juin 2013 son premier titre solo « vivre avec toi » qui remporte un vive succès.\r\n\r\nSoutenue par plusieurs radios tels que Tropique FM, Espace FM, le Blog du Zouk et bien d''autres, son premier titre "Vivre avec Toi" rencontre un vif succès depuis sa sortie en juin 2013.\r\nDès lors tout s’enchaine, interviews (radios et presse), prestations scénique (Le Palacio, salon Mangroves, l’Acropole, etc…) c’est donc tout naturellement qu’elle décide de sortir son second titre intitulé « DSL » (désolé).\r\nInterprété en featuring avec l’artiste Mainy dog, « DSL » est un titre inspirée d’histoires vraies qui décrit la complexité et la déception d’une rupture amoureuse.', '2013-10-26 13:52:00', 'mel-s', '171596736344791', 'mels_officiel'),
