(231, 'Audrey mas', 'Jeune artiste au métissage congolais/guadeloupéen, qui a déjà quelques singles à son actif. Dans ces projets elle a eu à faire notamment à une direction artistique de choix ( MasterCWill, Ali Angel...) qui permet à Audrey Mas de poursuivre son chemin en diversifiant ses œuvres, afin qu''anonymes et professionnels apprécient son ouverture musical.', '2013-11-23 11:20:00', 'audrey-mas', 'audreymasfanpage', NULL),
(232, 'Milca', 'Jeune artiste née en Guyane d''origine haïtienne, Milca fait ses premiers pas dans la musique RnB.\r\nMais très vite les rythmes Afro-Caribéens font leurs apparitions dans sa carrière.\r\n\r\nEn 2005, elle nous offre un cadeau incontournable, avec son premier album ‘’Simplement’’ Milca nous berce avec sa voix envoutante et chaleureuse, des textes sincères et vrais comme Simplement, are U ready, mauvais passages, le temps et dans tes bras.\r\n\r\nCe premier succès conduit Milca à une notoriété internationale ainsi qu’au prestigieux titre de meilleure interprète féminine au palmarès des Trophées des arts afro-caribéens en 2007.\r\n\r\nCette année est signe de renouveau, en effet en collaboration avec sa nouvelle production, Milca nous revient de plus bel avec son nouveau titre intitulé Que des mots en exclusivité sur la compilation Bien Glacé. Son nouvel album ''''PAR AMOUR'''' actuellement disponible est sans doute l''un des meilleurs albums zouk de sa génération !!', '2013-11-23 12:42:00', 'milca', 'Milcaofficiel', 'MILCAOFFICIEL'),
