(242, 'M''dy', 'De son vrai nom Elodie Maurinier, M''dy est une artiste zouk originaire de la Guadeloupe. \r\nElle est en auto-production pour le moment.\r\nElle a écrit et composé son premier titre avec la collaboration de Mister Francky (Franck Filliole) pour ce qui est de la mélodie.', '2013-11-28 07:13:00', 'm-dy', NULL, NULL),
