(244, 'Damien Marley', 'Damian marley aka Junior Gong est le fils du bien célèbre Bob marley, c''est aussi un artiste jamaïcain qui perce dans le reggae.', '2013-12-05 21:28:00', 'damien-marley', 'damianmarley', 'damianmarley'),
(245, 'B-jay', 'B-jay, de son vrai nom Jérémie battery, est originaire de la Martinique et de la Guyane.\r\n\r\nSa passion précoce pour la musique l''amène à composer ces premières notes dès l''âge de 5 ans.\r\n\r\nIl débute très rapidement sa carrière professionnelle. Agé de seulement 14 ans, B-Jay intègre la « Battery Family », groupe de gospel formé par sa famille.\r\n\r\nIl enchainera avec, plus de 200 concerts à travers toute la France dont une prestation remarquée sur M6 dans l''émission « Hit Machine » présentée par Charly et Lulu.\r\n\r\nTout en restant membre du groupe, B-Jay assura les chœurs pour Piero Battery, lors de l''émission « Jubil Musique » et d''un concert à la Cigale.\r\n\r\nDe 2005 à 2009, il participe au Gospel session au Bizz''art, ou il y fera forte impression.\r\n\r\nJuin 2008, B-Jay entame sa carrière solo et réalise son 1er clip « Oh lèves les mains » diffusé sur plusieurs chaines télévisées telles que Trace TV, MCM ou encore MTV BASE.\r\n\r\nEn Novembre 2008, B-Jay accompagne Christophe Maé en tant que choriste gospel lors de ces concerts au Palais des Sports puis en Mars 2011, c''est aux cotés de Yaël Naïm, élue artiste féminine de l''année qu''il se produit lors des victoires de la musique.\r\n\r\nIl sort son nouveau titre « Cœur d’Un Soldat », un titre r&b produit par Moonlight Music en Septembre 2011.\r\n\r\nB-Jay vous transportera dans son univers musical, mélangeant les rythmes R&b et les sonorités carribeans…', '2013-12-06 11:46:00', 'b-jay', 'bjayofficiel', NULL),
(246, 'Soumia', 'Soumia est une chanteuse franco-marocaine. Elle a déjà 3 albums à son actif produit par kaysha.', '2013-12-06 21:26:00', 'soumia', 'SRsoumia', 'Soumiaofficiel'),
