(250, 'Linzy bacbotte', 'Elle est sans conteste la plus belle voix féminine de Maurice. Linzy Bacbotte\r\ndégage à travers ses chansons des émotions vraies dépeignant la réalité\r\npure de son pays. Auteur de divers opus éclectique allant du séga au\r\nreggae en passant par le zouk et de R&B, elle est une artiste ouverte sur le\r\nmonde. Linzy chante des textes engagés et met son talent artistique au service\r\ndu social, en défendant les droits des femmes et des enfants et participe à la\r\nlutte contre le sida.', '2013-12-10 14:18:00', 'linzy-bacbotte', NULL, NULL),
(251, 'Njie', 'Artiste Zouk guadeloupéene que l''on connais depuis 1993 et son fameux "Tempo 106" déjà repris avec succès depuis. Elle enchaine les succes, puis après une longue pause sans nouveau titre, elle nous revient avec des titres tout aussi efficace qu''auparavant.', '2013-12-11 07:35:00', 'njie', 'NJIE.fan.page', 'NJIEALBUM'),
