(254, 'Dominik coco', 'Dominik COCO est un artiste connu pour ses succès dans le milieu du zouk avec "Volt face" mais pas seulement, en solo il s''est plutôt orienté vers les racines du pays et les traditions, passant par le gwo ka, la biguine sans oublier le reggae', '2013-12-12 12:12:00', 'dominik-coco', 'DominikCoco.Officiel', NULL),
(255, 'Warren', 'Artiste zouk guyannais', '2013-12-12 19:42:00', 'warren', 'WarrenZouk', 'MusicWarren'),
(256, 'Fanny j', 'Fanny J, de son vrai nom Fanny Jacques-André-Coquin, chanteuse de zouk et n''n''b est née le 6 octobre 1987 Guyane.  Elle se découvre une passion pour la musique dès son plus jeune âge et participe à  plusieurs concours de chant. En 2007, elle est repérée par Warren, chanteur, producteur et compositeur guyanais qui lui compose son premier tube "Ancrée à ton port" puis son premier album "Vous les Hommes" qui cartonnera et pour lequel elle fera la promotion en Europe, en Afrique et aux Etats-Unis.\r\n\r\nLa carrière musicale de Fanny J est désormais lancée.\r\n\r\nTrois ans après, son second album intitulé "Secret de Femme", dans lequel la chanteuse s''adonne à de nombreuses collaborations avec d''autres artistes (Black Kent, Admiral T, Krys, Slaï....) entérine son succès en se plaçant en tête des ventes.\r\n\r\nDepuis 2010, Fanny J est l''une des artistes antillaises à avoir fait de plusieurs concerts dans les salles mythiques parisiennes. En 2010, elle s''est produit au Zenith de Paris et en 2012, à l''Olympia.\r\n\r\nToujours à la recherche de nouvelles expériences musicales, Fanny J a récemment participé à la compilation "Tropical Family" dans laquelle elle reprend la chanson des Zouk Machine, "Maldon" en compagnie de Louisy Jospeh et Lynnsha,  qui sera le tube de l''été 2013.', '2013-12-12 19:45:00', 'fanny-j', 'FannyJofficiel', 'OfficielFannyJ'),
