(299, 'Brick and lace', 'De leur vrai nom Nailah et Nyanda sont des sœurs (pas jumelles malgré les apparence) qui ont enflammé le danceflore dans les année 2007', '2014-01-06 14:12:00', 'brick-and-lace', NULL, NULL),
(300, 'Kassav', 'Groupe mythique et fondateur du zouk composé de  	Jocelyne Béroard,\r\nJacob Desvarieux,\r\nJean-Philippe Marthély,\r\nJean-Claude Naimro, et Georges Décimus!\r\n(description à venir)', '2014-01-06 14:18:00', 'kassav', 'kassavofficiel', NULL),
(301, 'All mighty crew', 'All Mighty Crew est un groupe originaire de Saint Laurent du Maroni, composé de SENSI ASMA, DON-G et MAJESTY.\r\n\r\nEn 2012, le groupe décide de traverser l''Atlantique pour s''installer en France métropolitaine \r\nafin de développer sa musique et la faire connaitre d''un plus large public.\r\nC''est sur Le Mans(72) avec le groupe DAMANIAK originaire de la même ville qu''ils travaillent \r\net font naître leur propre concept comme ils l''ont si bien baptisé " Dancehall/Hip Hop Fun", un mélange d''humour, fun et de vécu.\r\nProduit par un des label du groupe DAMANIAK "PIT WILLIAM PRODUCTION", ils sortent leurs premiers titres "BURGER FRITES SODAS", "WINE" et "DANCEHALL 90''s"\r\nde pure délire qui lance le début d''un long apogée.\r\n\r\nFin  2013, le groupe revient avec un nouveau délire cette fois-ci sur une rythmique envoûtante carnavalesque, le titre « AMIZMAN » annonce l''ouverture des festivités de cette nouvelle année.', '2014-01-06 20:02:00', 'all-mighty-crew', '191159947652477', NULL),
